"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[4143],{2772:function(e){e.exports=JSON.parse('{"route":"talks","tag":"GO","articles":[{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-mentoria-2025","date":"2025-12-13T14:35:00Z","authors":["Weslley Ara\xfajo"],"tags":["Brasil","GO","Goi\xe2nia"],"content":"\\n\ud83c\udf93 **Mentoria:** Open Source e todo seu ecossistema \u2728\\n\\n:::note Resumo\\n\\nMentoria aberta sobre open source, introduzindo temas e abrindo um **Q&A** de forma descontra\xedda para todos os n\xedveis de desenvolvedores.\\n\\n:::\\n\\n{/* truncate */}\\n\\nimport { Moments } from \'@Moments\';\\n\\n<hr />\\n\\nAlguns dos temas abordados:\\n\\n- Por que eu devo contribuir com o open source?\\n- Como encontrar projetos para contribuir?\\n- Como atrair contribuidores para nossos projetos?\\n- Como garantir a consist\xeancia e padroniza\xe7\xe3o da nossa _codebase_ ao aceitar contribui\xe7\xf5es de todo o mundo?\\n- Quando e como recusar contribui\xe7\xf5es?\\n- E, naturalmente, muito mais \u2728\\n\\n<hr />\\n\\n<Moments\\n  moments={[\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/13.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/08.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/09.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/10.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/11.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/12.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/14.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/15.jpg\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/16.jpg\' },\\n    {\\n      src: \'/img/talks/devfest-cerrado-2025/moments/19.jpeg\',\\n      alt: \'Paulo Handerson (PorteraTech) e eu\',\\n    },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/17.png\' },\\n    { src: \'/img/talks/devfest-cerrado-2025/moments/18.jpeg\' },\\n  ]}\\n/>\\n","filePath":"devfest2.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/devfest2.mdx","summary":[],"description":"\ud83c\udf93 **Mentoria:** Open Source e todo seu ecossistema \u2728\\n\\n:::note Resumo\\n\\nMentoria aberta sobre open source, introduzindo temas e abrindo um **Q&A** de forma descontra\xedda para todos os n\xedveis de desenvolvedores.\\n\\n:::","social":"./banner2.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/banner2.jpeg","readingTime":1,"lastModified":"2026-01-22T03:43:05.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, Microsoft MVP, mantenedor do MySQL2 e criador do Poku \u2728","url":"https://weslley.io","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"nextArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-2025","description":"\ud83c\udf99\ufe0f **Palestra:** Do C\xf3digo para o Mundo Real: O Ponto de Encontro entre Dados, Testes e Seguran\xe7a\\n\\n:::note Resumo\\n\\nVamos desmistificar tudo que voc\xea conhece por desenvolvimento e entender como tornar nossa aplica\xe7\xe3o previs\xedvel contra o imprevis\xedvel.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/banner.jpeg"}},{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","order":-2,"slug":"devfest-cerrado-google-developer-groups-gdg-2025","date":"2025-12-13T14:00:00Z","authors":["Weslley Ara\xfajo"],"tags":["Brasil","GO","Goi\xe2nia"],"content":"\\n\ud83c\udf99\ufe0f **Palestra:** Do C\xf3digo para o Mundo Real: O Ponto de Encontro entre Dados, Testes e Seguran\xe7a\\n\\n:::note Resumo\\n\\nVamos desmistificar tudo que voc\xea conhece por desenvolvimento e entender como tornar nossa aplica\xe7\xe3o previs\xedvel contra o imprevis\xedvel.\\n\\n:::\\n\\n{/* truncate */}\\n\\nimport { Moments } from \'@Moments\';\\nimport { Side } from \'@Side\';\\n\\n<hr />\\n\\n<Side id=\\"resume\\">\\n\\nTestar o funcionamento da nossa aplica\xe7\xe3o? Isso \xe9 f\xe1cil.\\nQuebrar nossa aplica\xe7\xe3o antes do pr\xf3prio usu\xe1rio ou de um invasor? Essa \xe9 diferente.\\n\\nMais do que testar, voc\xea vai aprender a criar sistemas seguros (de verdade) e entender na pr\xe1tica o impacto da transforma\xe7\xe3o dos dados da pior forma poss\xedvel: atrav\xe9s de invas\xf5es reais.\\n\\nE se voc\xea acha que seguran\xe7a \xe9 s\xf3 sobre c\xf3digo, at\xe9 a LGPD vai passar por aqui pela perspectiva de algu\xe9m que conseguiu acessar nosso banco de dados na \xedntegra.\\n\\nVoc\xea vai perceber que testes n\xe3o s\xe3o uma tarefa a mais: eles fazem parte da nossa aplica\xe7\xe3o e s\xe3o essenciais para a seguran\xe7a digital e humana.\\n\\n</Side>\\n\\n<Side id=\'moments\'>\\n  <Moments\\n    moments={[\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/01.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/02.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/03.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/04.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/05.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/06.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/07.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/14.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/15.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/16.jpg\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/17.png\' },\\n      { src: \'/img/talks/devfest-cerrado-2025/moments/18.jpeg\' },\\n    ]}\\n\\n/>\\n\\n</Side>\\n\\n<Side id=\'study\'>\\n\\nO lado te\xf3rico da palestra, mostrando todas as vulnerabilidades exploradas, seus respectivos impactos e medidas de mitiga\xe7\xe3o do ponto t\xe9cnico atrav\xe9s da **OWASP** e **CWEs**.\\n\\nReposit\xf3rio no **GitHub** do material de estudo e refer\xeancia:\\n\\n- [github.com/wellwelwel/devfest-cerrado-2025](https://github.com/wellwelwel/devfest-cerrado-2025)\\n\\n:::note\\nDevido \xe0 abordagem que mostra vulnerabilidades funcionando na pr\xe1tica, esse \xe9 um slide exclusivo para quem participou da palestra presencialmente \ud83e\udd1d\\n:::\\n\\n</Side>\\n","filePath":"devfest.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/devfest.mdx","summary":[],"description":"\ud83c\udf99\ufe0f **Palestra:** Do C\xf3digo para o Mundo Real: O Ponto de Encontro entre Dados, Testes e Seguran\xe7a\\n\\n:::note Resumo\\n\\nVamos desmistificar tudo que voc\xea conhece por desenvolvimento e entender como tornar nossa aplica\xe7\xe3o previs\xedvel contra o imprevis\xedvel.\\n\\n:::","social":"./banner.jpeg","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/banner.jpeg","readingTime":2,"lastModified":"2026-01-22T03:43:05.000Z","sides":[{"id":"moments","label":"Momentos \ud83c\udf9e\ufe0f"},{"id":"resume","label":"Resumo \ud83d\udcdd"},{"id":"study","label":"Material de Estudo \ud83d\udcda"}],"authorsData":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, Microsoft MVP, mantenedor do MySQL2 e criador do Poku \u2728","url":"https://weslley.io","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg-mentoria-2025","description":"\ud83c\udf93 **Mentoria:** Open Source e todo seu ecossistema \u2728\\n\\n:::note Resumo\\n\\nMentoria aberta sobre open source, introduzindo temas e abrindo um **Q&A** de forma descontra\xedda para todos os n\xedveis de desenvolvedores.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/12/13/banner2.jpeg"},"nextArticle":{"title":"Dev Refer\xeancias","slug":"dev-referencias","description":"\ud83c\udf99\ufe0f **Palestra:** Como se Tornar uma Refer\xeancia na \xc1rea Tech\\n\\n:::note Resumo\\n\\n\ud83d\udca1 Uma palestra que traz um aprendizado \xfanico sobre como gerar **impacto** e **inspira\xe7\xe3o** atrav\xe9s do que fazemos.\\n\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/11/08/banner.jpeg"}},{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","slug":"devfest-cerrado-google-developer-groups-gdg","date":"2024-11-23","authors":["Weslley Ara\xfajo"],"tags":["Brasil","GO","Goi\xe2nia"],"content":"\\n\ud83c\udf99\ufe0f **Palestra:** Superando a s\xedndrome do impostor e os desafios de existir no mercado atrav\xe9s do open source.\\n\\n:::note Resumo\\nNesse momento em que muitos programadores se sentem inseguros sobre o futuro da \xe1rea, trazer t\xf3picos sens\xedveis como inseguran\xe7a, complexo de inferioridade e autossabotagem, com uma luz no fim do t\xfanel atrav\xe9s da iniciativa open source, foi bem desafiador, mas muito interessante:\\n:::\\n\\n{/* truncate */}\\n\\n<hr />\\n\\n## \ud83d\udca1 A escolha do tema\\n\\n- Ser\xe1 que o meu n\xedvel \xe9 suficiente?\\n- Eu devo desistir se n\xe3o conseguir um emprego na minha \xe1rea?\\n- Como adquirir experi\xeancias se o mercado n\xe3o me d\xe1 oportunidades?\\n\\n## \ud83e\uddd1\ud83c\udffb\u200d\ud83d\udd2c O desenvolvimento\\n\\nEu poderia facilmente explicar o que \xe9 s\xedndrome do impostor e ir direto para a \u201csolu\xe7\xe3o\u201d, mas optei pelo caminho mais dif\xedcil:\\n\\n\u2014 Expor minhas fraquezas durante minha trajet\xf3ria, conversando em um tom pr\xf3ximo ao que seria um desabafo.\\n\\nO intuito era me conectar com quem estivesse ali, evoluir para aprendizado e, quem sabe, inspirar atrav\xe9s da minha hist\xf3ria, compartilhando o lado humano que as redes sociais e os \\"t\xedtulos de LinkedIn\\" n\xe3o mostram.\\n\\n## \ud83d\udc7b Os desafios\\n\\nFalar sobre nossas falhas e inseguran\xe7as para pessoas que nem nos conhecem \xe9 mais complicado do que parece, as pessoas gostam de ouvir algu\xe9m que elas possam admirar.\\n\\nMas os coment\xe1rios e o carinho das pessoas que vieram falar comigo no final, me mostraram que a ideia de me conectar com quem estava ali n\xe3o s\xf3 deu certo, mas que realmente serviu de inspira\xe7\xe3o para algumas pessoas e isso me deixou muito feliz \u2728\\n\\n## \ud83c\udfa4 A palestra\\n\\nFiquei pensativo se as pessoas se interessariam por esse tema, mas aos poucos a sala foi ficando cheia e uma pessoa at\xe9 sentou no ch\xe3o no comecinho.\\n\\nOriginalmente, a apresenta\xe7\xe3o tinha alguns estudos complementares, incluindo telas pr\xe1ticas com contribui\xe7\xf5es open source reais, mas precisei adaptar algumas coisas pra caber no formato e tempo do evento.\\n\\n:::tip\\n\\nSpoiler (GIF) do slide utilizado na palestra:\\n\\n![Banner](./slide.gif)\\n\\n:::\\n","filePath":"devfest-cerrado-google-developer-groups.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2024/11/23/devfest-cerrado-google-developer-groups.mdx","summary":[{"text":"\ud83d\udca1 A escolha do tema","level":2,"items":[]},{"text":"\ud83e\uddd1\ud83c\udffb\u200d\ud83d\udd2c O desenvolvimento","level":2,"items":[]},{"text":"\ud83d\udc7b Os desafios","level":2,"items":[]},{"text":"\ud83c\udfa4 A palestra","level":2,"items":[]}],"description":"\ud83c\udf99\ufe0f **Palestra:** Superando a s\xedndrome do impostor e os desafios de existir no mercado atrav\xe9s do open source.\\n\\n:::note Resumo\\nNesse momento em que muitos programadores se sentem inseguros sobre o futuro da \xe1rea, trazer t\xf3picos sens\xedveis como inseguran\xe7a, complexo de inferioridade e autossabotagem, com uma luz no fim do t\xfanel atrav\xe9s da iniciativa open source, foi bem desafiador, mas muito interessante:\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2024/11/23/banner.png","readingTime":2,"lastModified":"2026-01-22T03:43:05.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, Microsoft MVP, mantenedor do MySQL2 e criador do Poku \u2728","url":"https://weslley.io","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"GitHub Brasil \u2014 Open Source Friday","slug":"github-brasil-open-source-friday","description":"\ud83d\udcf9 **Palestra (Live):** Conhecendo o [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nEm um bate papo tanto t\xe9cnico, como casual, tive a honra de estrear a primeira edi\xe7\xe3o do **Open Source Friday** da [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), apresentado pela [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2025/03/14/banner.png"},"nextArticle":{"title":"Microsoft Reactor e NodeBR","slug":"microsoft-reactor-e-nodebr","description":"\ud83c\udf99\ufe0f **Palestra:** Criando um Test Runner Multi-Plataforma de Alta Performance.\\n\\n:::note\\nO foco da palestra consistiu na import\xe2ncia de delegar as responsabilidades de cada problema usando recursos nativos do **Node.js**.\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/pt-BR/talks/2024/08/30/banner.jpeg"}}]}')}}]);